  `code` varchar(255) DEFAULT NULL COMMENT 'Internal code of the stop',
  PRIMARY KEY (`stop_id`),
  KEY `fleet_id` (`fleet_id`),
  KEY `peer_stop_id` (`peer_stop_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `stop_ibfk_1` FOREIGN KEY (`fleet_id`) REFERENCES `fleet` (`fleet_id`),
